import styled from 'styled-components'
import * as appStyles from '../appStyle'

export const Cart = styled.div`
    display : flex;
    position : absolute;
    background-color : ${appStyles.stickyCart};
    top : 0;
    left: 0;
    right: 0;
    color : white;
    padding : 20px;
    margin-left: 20px;

`
